import React from 'react';


import classes from './AboutMe.module.css';
const AboutMe=() =>{

    const downloadCv = ()=>{
        fetch('ANIBAL_JUAREZ_-CV-_Développeur_Web.pdf').then(response => {
            response.blob().then(blob => {
                // Creating new object of PDF file
                const fileURL = window.URL.createObjectURL(blob);
                // Setting various property values
                let alink = document.createElement('a');
                alink.href = fileURL;
                alink.download = 'ANIBAL_JUAREZ_-CV-_Développeur_Web.pdf';
                alink.click();
            })
        })
    }
    return (
        <div className={classes.about_me}>
            <div className={classes.information}>
                <p>Je m'appelle</p>
                <h1>Anibal Juarez</h1>
                <p>Je suis</p>
                <p className={classes.title}>Developpeur Web</p>
                <button onClick={downloadCv}>Télécharger CV</button>
            </div>


        </div>
    );
}

export default AboutMe;
